import Link from "next/link";
import useSWR from "swr";

const fetcher = url => fetch(url).then(r => r.json());

export default function Index() {
  const { data, error } = useSWR("/api/taest", fetcher);
  if (error) throw error;
  return (
    <>
      <h1>Text: {(data && data.text) || "Loading..."}</h1>
      <h2>Author: {(data && data.author) || "Loading..."}</h2>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
